// 기본 구조
const initialState = {
    mainPosts: [
        {
            id: 1,
            user: { id: 1, nickname: "동현이" },
            content: "동현이의 첫 번째 게시글! #앙 #기모찌"
        }
    ]
};

const reducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state;
    }
};

export default reducer;
